import './App.css';
import { Container } from '@mui/system';
import { Grid } from '@mui/material';
import { BrowserRouter, Route, Routes } from "react-router-dom";

import Header from './components/Header/Header';
import Footer from './components/Footer/Footer';
import Profile from './components/Profile/Profile';
import Resume from './pages/Resume/Resume';
import Portfolio from './pages/Portfolio/Portfolio';

function App() {
  return (
    <div style={{backgroundColor: "black"}}>
      <Container className="top_60">
          <Grid container item xs={12} spacing={3}>
            <Grid item xs={12} md={4}>
              <Profile />
            </Grid>
            <BrowserRouter>
              <Grid container item xs={12} md={8} className='browser_router'>
                <div container item xs={12} className="header">
                  <Header />
                </div>
                <div container item style={{backgroundColor: "green"}} className="body_content">
                    <Routes>
                      <Route path='/' element={<Resume />} /> 
                      <Route path='/portfolio' element={<Portfolio />} />
                      <Route path='/resume' element={<Resume />} />
                    </Routes>
                </div>
                <div container item style={{backgroundColor: "blue"}} className="footer">
                  <Footer />
                </div>
              </Grid>
            </BrowserRouter>
          </Grid>
      </Container>
    </div>
  );
}

export default App;
